		  <script type="text/javascript">
			$(function(){ 	
				window.addEventListener( 'resize', onWindowResize, false );
				document.getElementById('begin').addEventListener('click', begin);
				
			function begin(){
				document.getElementById("begin").style.visibility = "hidden";
				init();
			}
			
				function init() {
					renderer.setClearColor(0x000000, 1.0);
					renderer.setSize(window.innerWidth, window.innerHeight);
					scene.add(camera);
					camera.position.set(-4,-6,2);
					var light = new THREE.DirectionalLight(0xFFFFFF,1);
					var light2 = new THREE.DirectionalLight(0xFFFFFF,0.5);
					light.position.set(-30,20,15);
					light2.position.set(-30,-10,15);
					light.lookAt({x:0,y:0,z:0});
					light2.lookAt({x:0,y:0,z:0});
					scene.add(light);
					scene.add(light2);
					camera.lookAt(0,0,2);
					listmaker();
					wordsetup();
					const listener = new THREE.AudioListener();
					camera.add(listener);
					const sound = new THREE.Audio(listener);
					const audioLoader = new THREE.AudioLoader();
					audioLoader.load("https://raw.githubusercontent.com/Blunderbread/threejsmaze/master/maze/masterwheel/textures/jwris.mp3", function( buffer ) {
						sound.setBuffer( buffer );
						sound.setLoop( true );
						sound.setVolume( 0.3 );
						sound.play();
					});
				};
				
				function onWindowResize(){
					var width = window.innerWidth;
					var height = window.innerHeight;
					camera.updateProjectionMatrix();
					renderer.setSize(window.innerWidth,window.innerHeight);
				};
				
				function wordsetup(aminew=true) {
					if (aminew==false || aminew.type=="click") {
						try {
							for (i=0;i<scrollist.length;i++) {
								scene.remove(scrollist[i])
							};
						}
						catch(e) {};
					};
					var loader = new THREE.FontLoader();
					wma = []
					b=Math.floor(Math.random()*jimwords.length)
					loader.load( 'https://raw.githubusercontent.com/Blunderbread/threejsmaze/master/maze/masterwheel/helvetiker_regular.typeface.json', function (font) {
						for (i=b;i<b+15;i++) {
							var wordgeom = new THREE.TextGeometry(jimwords[i], {
								font: font,
								size: 0.5,
								height: 0.05,
								curveSegments: 6
							} );
							wma.push(wordgeom)
						}
						for (i=b;i<b+15;i++) {
							word = new THREE.Mesh(wma[i],new THREE.MeshLambertMaterial({color:0xFFFFFF}));
							word.rotation.y = Math.PI/-2;
							word.name = (i).toString()+"w";
							scrollist.push(word);
							c=14-(1.25*(i-b))
							word.position.set(0,c,0);
							scene.add(word);
						};
					});
				}
				
				
				function wordswap() {
					while (scrollist[0].position.y>10.5) {
						scene.remove(scrollist[0]);
						b = scrollist.shift();
						a = parseInt(scrollist[scrollist.length-1].name.slice(0,scrollist[scrollist.length-1].name.length-1))+1;
						if (a>jimwords.length-1) {a=0};
						var loader = new THREE.FontLoader();
						loader.load( 'https://raw.githubusercontent.com/Blunderbread/threejsmaze/master/maze/masterwheel/helvetiker_regular.typeface.json', function (font) {
							var wordgeom = new THREE.TextGeometry(jimwords[a], {
								font: font,
								size: 0.5,
								height: 0.05,
								curveSegments: 6
							})
							wma[a%wma.length]=wordgeom;
						})
						word = new THREE.Mesh(wma[a%wma.length],new THREE.MeshLambertMaterial({color:0xFFFFFF}));
						word.rotation.y -= Math.PI/2;
						word.name = a.toString()+"w";
						word.position.set(0,scrollist[scrollist.length-1].position.y-1.25,0);
						scene.add(word);
						scrollist.push(word);
					};
				};

				function renderScene() {
					requestAnimationFrame(renderScene);
					renderer.render(scene,camera);
					deltfr = fps.getDelta();
					if (scrollist.length>0){
						for (i=0;i<scrollist.length;i++) {
							scrollist[i].position.y += (spinvel*60*deltfr)/(2*Math.PI);
						}
						if ((scrollist[scrollist.length-1].position.y<-5.5) || (scrollist[0].position.y>5.5)) {wordswap()};
					}
					scene.updateMatrixWorld();
				};
				var fps = new THREE.Clock();
				fps.start();
				var spinvel=0.05
				var scrollist = [];
				var scene = new THREE.Scene();
				var camera = new THREE.PerspectiveCamera(40,1920/1080,1,100);
				var renderer = new THREE.WebGLRenderer({antialias:true});
				$("#WebGL-output").append(renderer.domElement);
				renderScene();
			});
